const width = 125
const height = 125
const centerP = [width / 2, height / 2]
const numbLStars = 100
const numbBStars = 50
const numbTree = 10
const moonRadius = 11
const moonPoint = [
  bt.randInRange(10, width - 10),
  bt.randInRange(30, height - 10)
]



setDocDimensions(width, height)

//making john
const john = new bt.Turtle()

john.jump([0, 5])

//while loop
//i just a variable leave it as 0
//i < 10 is how many times it repeats
let i = 0
while (i < 1) {
  john.forward(125)
  i = i + 1
}

////////////////////////////////////
//////////////////////////////////// fred
////////////////////////////////////

const fred = new bt.Turtle()

let k = 1

const bigStarPoints = []

bigStarLoop: while (k < numbBStars) {
  k = k + 1

  const point = [
    bt.randInRange(10, width - 10),
    bt.randInRange(30, height - 10)
  ]
  const size = bt.randInRange(1, -10)
  const rotation = bt.randInRange(-10, 10)

  const dist = distance(point, moonPoint)
  if (dist <= moonRadius + 10) continue

  for (const otherPoint of bigStarPoints) {
    const dist = distance(point, otherPoint)
    if (dist <= 10) continue bigStarLoop
  }

  bigStarPoints.push(point)


  fred.jump(point)
  fred.angle = 0
  fred.right(rotation)

  let j = 0
  while (j < 1) {
    j = j + 1
    fred.forward(3)
    fred.right(144)
    fred.forward(3)
    fred.left(72)
    fred.forward(3)
    fred.right(144)
    fred.forward(3)
    fred.left(72)
    fred.forward(3)
    fred.right(144)
    fred.forward(3)
    fred.left(72)
    fred.forward(3)
    fred.right(144)
    fred.forward(3)
    fred.left(72)
    fred.forward(3)
    fred.right(144)
    fred.forward(3)
  }
}

////////////////////////////////////
//////////////////////////////////// george
////////////////////////////////////


const george = new bt.Turtle()
let l = 0
while (l < numbLStars) {
  l = l + 1

  const point = [
    bt.randInRange(5, width - 5),
    bt.randInRange(30, height - 5)
  ]
  const size = bt.randInRange(1, 3)

  const dist = distance(point, moonPoint)
  if (dist <= moonRadius + 10) continue


  george.jump(point)

  george.arc(360, 0.3)

}

