const bob = new bt.Turtle()
const treePoints = []

let n = 1
treeLoop: while (n < numbTree) {
  n = n + 1

  const treePoint = [
    bt.randInRange(10, width - 5), 5 
  ]

  for (const otherPoint of treePoints) {
    const dist = distance(treePoint, otherPoint)
    if (dist <= 10) continue treeLoop
  }

  treePoints.push(treePoint)

  bob.jump(treePoint)
  bob.angle = 0
  let b = 0
  while (b < 1) {
    b = b + 1
    bob.left (90)
    bob.forward (8)
    bob.right (75)
    bob.arc (315,5)
    bob.right (60)
    bob.forward (8.4)
    bob.up()
    bob.forward(-15)
    bob.down()
    bob.forward(3)
    bob.up()
    bob.forward(1)
    bob.down()
    bob.arc(180,2)
    bob.up ()
    bob.forward(1)
    bob.down()
    bob.forward(3)

 }
} 
